INSERT INTO dreams_idioma VALUES(1,'How was your dream?','Unpleasant dream','Pleasant Dream','CONTINUE','YES, CANCEL','YES, CONTINUE','You just indicated
that your Dream was Unpleasant','You just indicated
that your Dream was Nice','Focus on a precise moment of a recent dream and indicate if it was pleasant or unpleasant.',1,'Add characters','Example: * Objects * Groups * Places * Parts of the body * Events * Animals * People, etc.','Dreams are a quick way to access our inner world. The elements and characters present in them are aspects of our personality','P1 and P2 are actually facets of you; what they experience, what they feel and the way they are considered, show the relationship you have with yourself.','To reach fullness it is important to start by becoming aware of these ways of being, acting and / or feeling manifested in your dreams.','* Mechanism by which we attribute our own aspects to others','What was the Unpleasantness of the dream?','The unpleasantness of the dream was ...','Online','Now you are','The pleasantness of the dream was','What was the Pleasant of the dream?','What were the characters or fundamental elements in the pleasant situation?','Hello, p1 How are you? I know little about you please describe','Good to know you p1 I would like you to tell me what you think about p2','Hi, p2 How are you? I know little about you please describe','Good to know p2 I would like you to tell me what you think about p1','Hello p1, p2 wants to meet you.','Hi p2, p1 wants to meet you.','It will result in many websites that use this text if they are in a state of development. Many versions have evolved over the years, sometimes by accident, other times on purpose','It will result in many websites that use this text if they are in a state of development. Many versions have evolved over the years, sometimes by accident, other times on purpose','Continue as p1','Continue as p2','p1 It says:','Fine','Bad','So so','To write...','help2','help3','help4','help5','help6','help7','help8','Hello p1, how are you','p2 It says:','good luck','hi','bye','Add nice characters','Add unpleasant characters','Character 1','Character 2','Log Out','Create a dream','Languages','My dreams','Dreams','# three','# four','# five','# six','# seven','Hello, p1 How are you? I know little about you please describe :D','Good to know you p1 I would like you to tell me what you think about p2 :D','Hi, p2 How are you? I know little about you please describe :D','Good to know p2 I would like you to tell me what you think about p1 :D','Hello p1, p2 wants to meet you. :D','Hi p2, p1 wants to meet you. :D');
INSERT INTO dreams_idioma VALUES(2,'Qu tan agradable o desagradable fue tu sueo?','Sueo Desagradable','Sueo Agradable','CONTINUAR','NO, CANCELAR','SI, CONTINUAR','Acabas de indicar
que tu Sueo fue Desagradable','Acabas de indicar
que tu Sueo fue Agradable','Enfcate en un momento preciso de un sueo reciente e indica qu tan agradable o desagradable fue',2,'Agregar personajes','Ejemplo: *Objetos *Grupos *Lugares *Partes del cuerpo *Eventos *Animales *Personas, etc.','Los elementos y personajes presentes en los sueos son aspectos de nuestra personalidad manifestados por nuestra psiquis mediante un lenguaje simblico. p1 y p2 son facetas tuyas que se encuentran en conflicto / proceso de reconciliacin','p1 y p2 representan facetas tuyas; lo que experimentan, lo que sienten y la forma en la que los consideras evidencian la relacin que tienes contigo mism@.','Los sueos son una va de acceso a nuestro mundo interior. Los elementos y personajes presentes en ellos son aspectos de nuestra personalidad que nuestra psiquis manifiesta mediante un lenguaje simblico, a modo de proyecciones*.

Para alcanzar la plenitud es importante hacer consciencia de estas formas de ser, actuar y/o de sentir.

*Mecanismo mediante el cual le atribuimos aspectos propios a otros

*Proyectamos como algo externo aquello que no reconocemos como propio','*Un personaje que oprime, agrede o lmita intencionalmente representa un saboteador o crtico interno','Qu fue lo Desagradable del sueo? Enfcate en un slo momento','Lo desagradable en ese momento del sueo fue que...','en lnea','Ahora eres','Lo agradable de ese momento del sueo fue que...','Qu fue lo Desagradable del sueo? Enfcate en un slo momento','Cuales fueron los 2 personajes o elementos fundamentales en la situacin agradable?','Hola p1, que gusto conocerte! S poco sobre ti, por favor describe aquello por lo que te caracterizas en condiciones normales','Que bueno conocerte p1. Me gustara que me cuentes qu piensas de p2 en el sueo','Hola p2, es un placer que hablemos! Cuntame qu te caracteriza en condiciones normales, as podr conocerte mejor','Que bueno conocerte p2. Me gustara que me dijeras que piensas de p1 en el sueo','Hola p1, p2 desea hablar contigo. Espero que logren expresar con honestidad todo aquello que hace falta. Buena suerte!','Hola p2, por favor contina la conversacin con p1 hasta que ambos logren reconocerse como aspectos en la personalidad de quin los so','Cierra los ojos, respira profunda y lentamente concentrndote en las sensaciones que P1 est(n) experimentando como parte del sueo. 

Contina cuando hayas logrado ponerte en su lugar y ests list@ para reaccionar como si fueras p1','Cierra los ojos, respira lentamente concentrndote en las sensaciones que P2 est experimentando como parte del sueo.

Presiona continuar cuando hayas logrado ponerte en su lugar y ests list@ para reaccionar como si fueras p2','Continuar como p1','Continuar como p2','p1 Dice:','Pienso igual. Tengo cosas que decirte','No s de que podamos hablar','No me agrada hacerlo pero s que es necesario...','Responder...','ayuda2
Bueno, pero primero dime: qu te agrada de mi?
Ok, pero antes quiero saber qu te desagrada de mi','ayuda3','ayuda4','ayuda5','ayuda6','ayuda7','Termina la conversacin cuando ambos personajes hayan compartido 1. Cmo se sienten en el sueo, 2. Aquello que les agrada o desagrada del otro. (Si hay alguien oprimido, intenta que venza)','Hola p1. Es bueno tener esta oportunidad de hablar','NULO:Seamos honestos y expresmos cmo nos sentimos','Est bien. Inicia t. Cmo te sientes y por qu?','Ok, pero primero qu te agrada o desagrada de mi?','Bueno, pero antes dime qu deseas de mi parte','Agrega los personajes agradables','Agrega los personajes desagradables','Personaje 1','Personaje 2','Cerrar Sesion','Crear un sueo','Idiomas','Mis sueos','Sueos','Ahora ponte en el lugar de p1. Expresa desde su punto de vista lo que piensa y siente en relacin con P2','Ahora ponte en el lugar de p2. Expresa desde su punto de vista lo que piensa y siente en relacin con P1','Reacciona como si fueras p1, intentando hacer consciencia de la faceta de tu personalidad que est representando','Contstale a p1 como p2, haciendo consciencia de que ambos son aspectos de tu personalidad. Contina hasta que hayan compartido lo qu les agrada o desagrada del otro.','Ahora eres p1. Finaliza la conversacin cuando ambas facetas de tu personalidad hayan logrado expresar: 

1. Cmo se sienten en el sueo
2. Aquello que les agrada o desagrada del otro.','Hola p1, que gusto conocerte! S poco sobre ti, por favor describe aquello por lo que te caracterizas en condiciones normales :D','Que bueno conocerte p1. Me gustara que me cuentes qu piensas de p1 en el sueo :D','Hola p2, es un placer que hablemos! Cuntame qu te caracteriza en condiciones normales, as podr conocerte mejor :D','Que bueno conocerte p2. Me gustara que me dijeras que piensas de p1 en el sueo :D','Hola p1, p2 desea hablar contigo. Espero que logren expresar con honestidad todo aquello que hace falta. Buena suerte! :D','Hola p2, por favor contina la conversacin con p1 hasta que ambos logren reconocerse como aspectos en la personalidad de quin los so :D');
INSERT INTO dreams_idioma VALUES(3,'Comment tait ton rve?','Rve dsagrable','Rve agrable','CONTINUER','OUI, ANNULER','OUI, CONTINUER','Vous venez d''indiquer
