que ton rve tait bien','Concentrez-vous sur un moment prcis d''un rve rcent et indiquez s''il tait plaisant ou dsagrable.',3,'Ajouter un caractre','Exemple: * Objets * Groupes * Lieux * Parties du corps * v','Les rves sont un moyen rapide d''accder  notre monde intrieur. Les lments et les caractres prsents en eux sont des aspects de notre personnalit reprsents par notre "Psych"  travers une lan','P1 et P2 sont en ralit des facettes de vous; Ce qu''ils ressentent, ce qu''ils ressentent et la manire dont ils sont considrs montrent la relation que vous entretenez avec vous-mme.','Pour atteindre la plnitude, il est important de commencer par prendre conscience de ces manires d''tre, d''agir et / ou de se manifester dans vos rves.','* Mcanisme par lequel nous attribuons nos propres aspects aux autres','Les rves sont un moyen rapide d''accder  notre monde intrieur. Les lments et les caractres prsents en eux sont des aspects de notre personnalit reprsents par notre "Psych"  travers une lan','Pour atteindre la plnitude, il est important de commencer par prendre conscience des manires d''tre, d''agir ou de ressentir qui se manifestent comme des projections dans nos rves.','* Mcanisme  travers lequel nous attribuons nos propres aspects aux autres.','Commenons - Fermez les yeux','L''agrment du rve tait','Quel tait le Pleasant du rve?','Quels taient les caractres ou les lments fonda','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
